<section class=""sectionWrapper bg_green poc-green-sec"">
    <div class=""container"">
        <div class=""section-title"">
            <h2 class=""text-white"">proof of concept</h2>
            <h5>You may test our proof of concept for yourself.</h5>
        </div>
        <div class=""upper-part"">
            <div class=""row align-items-center"">
                <div class=""col-md-8"">
                    <p>
                        Blockchain can increase the efficiency and transparency of supply chains and positively
                        impact everything from warehousing, delivery, and payment.
                    </p>
                    <p>
                        The vital things that are necessary for reliability and integrity in a supply chain, are
                        provided by the blockchain. Blockchain provides consensus on the data, there is no dispute
                        in the chain");
            WriteLiteral(@" regarding transactions because all entities on the chain have the same version
                        of the ledger. Everyone on the blockchain can see the chain of ownership for an asset on the
                        blockchain. Records on the blockchain cannot be erased which is important for a transparent
                        supply chain.
